const (
	NO_ROTATION  Rotation = 0
	ROTATION_90  Rotation = 1 // 90 degrees clock-wise rotation
	ROTATION_180 Rotation = 2
	ROTATION_270 Rotation = 3
)

type Rotation uint8

type Glyph struct {
	BitmapIndex uint16
	Width       uint8
	Height      uint8
	XAdvance    uint8
	XOffset     int8
	YOffset     int8
}

type Font struct {
	Bitmaps  []byte
	Glyphs   []Glyph
	First    byte
	Last     byte
	YAdvance uint8
}

type FontDraw struct {
	Font    *Font
	Display drivers.Displayer
	BGColor color.RGBA
}

func NewDraw(font *Font, display drivers.Displayer) FontDraw {
	white := color.RGBA{255, 255, 255, 255}
	return FontDraw{font, display, white}
}
func (f FontDraw) Info() {
	// message := []byte("ABCD")

	// inner, outer := f.LineWidth(message)
	// println("[OLED] inner, outer: ", inner, outer)
}

func (f FontDraw) DrawChar(display drivers.Displayer, font *Font, x int16, y int16, char byte, color color.RGBA) {
	f.DrawCharRotated(x, y, char, color, 0)
}

// DrawCharRotated sets a single char in the buffer of the display
func (f FontDraw) DrawCharRotated(x int16, y int16, char byte, color color.RGBA, rotation Rotation) {
	if char < f.Font.First || char > f.Font.Last {
		return
	}
	glyph := f.Font.Glyphs[char-f.Font.First]
	bitmapOffset := glyph.BitmapIndex
	bitmap := f.Font.Bitmaps[bitmapOffset]
	bit := uint8(0)
	for j := int16(0); j < int16(glyph.Height); j++ {
		for i := int16(0); i < int16(glyph.Width); i++ {

			if (bitmap & 0x80) != 0x00 {
				if rotation == 0 {
					f.Display.SetPixel(x+int16(glyph.XOffset)+i, y+int16(glyph.YOffset)+j, color)
				} else if rotation == 1 {
					f.Display.SetPixel(x-int16(glyph.YOffset)-j, y+int16(glyph.XOffset)+i, color)
				} else if rotation == 2 {
					f.Display.SetPixel(x-int16(glyph.XOffset)-i, y-int16(glyph.YOffset)-j, color)
				} else {
					f.Display.SetPixel(x+int16(glyph.YOffset)+j, y-int16(glyph.XOffset)-i, color)
				}
			}
			bitmap <<= 1

			bit++
			if bit > 7 {
				bitmapOffset++
				bitmap = f.Font.Bitmaps[bitmapOffset]
				bit = 0
			}
		}
	}
}

// WriteLine writes a string in the selected font in the buffer
func (f FontDraw) WriteLine(x int16, y int16, text []byte) {
	f.WriteLineRotated(x, y, text, f.BGColor, 0)
}

// writes line top left
func (f FontDraw) WriteTL(text []byte) {
	x := int16(0)
	y := int16(f.Font.YAdvance)
	f.WriteLine(x, y, text)
}

// writes line top right
func (f FontDraw) WriteTR(text []byte) {
	width, _ := f.LineWidth(text)
	x := int16(128 - 1 - width)
	y := int16(f.Font.YAdvance)
	f.WriteLine(x, y, text)
}

// writes line bottom left
func (f FontDraw) WriteBL(text []byte) {
	x := int16(0)
	y := int16(64 - 1)
	f.WriteLine(x, y, text)
}

// writes line bottom right
func (f FontDraw) WriteBR(text []byte) {
	width, _ := f.LineWidth(text)
	x := int16(128 - 1 - width)
	y := int16(64 - 1)
	f.WriteLine(x, y, text)
}

// writes line bottom right
func (f FontDraw) WriteC(text []byte) {
	width, _ := f.LineWidth(text)
	x := int16(128/2 - width/2)
	y := int16(64/2 + f.Font.YAdvance/2)
	f.WriteLine(x, y, text)
}

// WriteLineRotated writes a string in the selected font in the buffer
func (f FontDraw) WriteLineRotated(x int16, y int16, text []byte, color color.RGBA, rotation Rotation) {
	rotation = rotation % 4
	w, h := f.Display.Size()
	l := len(text)
	for i := 0; i < l; i++ {
		glyph := f.Font.Glyphs[text[i]-f.Font.First]
		//if x+int16(glyph.XAdvance) >= 0 {
		f.DrawCharRotated(x, y, text[i], color, rotation)
		//}
		if rotation == 0 {
			x += int16(glyph.XAdvance)
		} else if rotation == 1 {
			y += int16(glyph.XAdvance)
		} else if rotation == 2 {
			x -= int16(glyph.XAdvance)
		} else {
			y -= int16(glyph.XAdvance)
		}

		// speed up?
		if (rotation == 0 && x > w) ||
			(rotation == 1 && x > h) ||
			(rotation == 2 && x < 0) ||
			(rotation == 3 && y < 0) {
			break
		}
	}
}

func (f FontDraw) LineWidth(text []byte) (innerWidth uint32, outboxWidth uint32) {
	for i := range text {
		glyph := f.Font.Glyphs[text[i]-f.Font.First]
		outboxWidth += uint32(glyph.XAdvance)
	}
	innerWidth = outboxWidth
	// first glyph
	glyph := f.Font.Glyphs[text[0]-f.Font.First]
	innerWidth -= uint32(glyph.XOffset)

	// last glyph
	glyph = f.Font.Glyphs[text[0]-f.Font.First]
	innerWidth += -uint32(glyph.XAdvance) + uint32(glyph.XOffset) + uint32(glyph.Width)
	return
}

